  description: '  由於社會科學自動化工具的缺乏，往往導致語言學研究進度的推遲。念及在資訊發達的今日，人類的自然語言正在各種電子空間中累積成無法以傳統人力處理的海量資料規模成長。為了呼應社會科學及語言學相關研究領域的需求，卓騰語言科技耗時兩年開發的
    DTLK (卓騰語言學田野研究工具組) 特地透過本次參加自由軟體達人創作活動的機會，釋出原始碼及跨平台的執行檔。  除了原始碼外，我們也同步釋出可直接使用的
    MacOSX、Windows 以及 Linux 的版本。甚至連說明文件的原始檔都一併釋出。  DTLK 是 Droidtown Linguistic Field
    Research Kit 的縮寫。本軟體開發的目的在於提供語言學家與語言研究者一個「操作簡單美觀」、「價錢便宜 (甚至免費)」以及「專業功能強大」的語料收集軟體。  DTLK
    仍是一個進行中的專案。目前完成度最高的為 Clip Recorder 近一年內較大的更動皆參考了音韻/語音學領域的國際知名學者 Dr. Hume (http://www.ling.ohio-state.edu/~ehume/)
    的建議加以改進。  除自由軟體鑄造場外，我們亦在本公司的開放源碼頁中列出程式主畫面供您參考 (http://droidtown.github.io/audio_hackeado/)。  其餘四項功能亦在規劃、進行當中。如果您有任何建議，歡迎與我們聯絡討論。(info.center@droidtown.co)'
